   "source": [
    "**Some interesting discoveries from this summary:**\n",
    "\n",
    "* Average sedentary time is 991 minutes or 16 hours. \n",
    "\n",
    "* The majority of the participants are lightly active (average 192.8 minutes). However fairly active participants average 13.56 minutes, and for very active it's 21.16 minutes. The CDC recommends 150 minutes per week of moderate (fair) intensity aeorbic training, or 75 minutes per week of vigorous (very active) intensity aeorbic training. As well as 2 or days of muscle strengthening activities. \n",
    "\n",
    "* On the average, participants sleep 1 time for about 7 hours.\n",
    "\n",
    "* The average participant weighs 158 pounds and has a BMI of 25.19. \n",
    "\n",
    "* According to CDC research for adults of the age 20 years or older a \"healthy weight\" BMI is between 18.5 - 24.9. BMI above this number are considered overweight to obese.  \n",
    "\n",
    "* Average total steps per day are 7638 which a little bit less for having health benefits for according to the CDC research. They found that taking 8,000 steps per day was associated with a 51% lower risk for all-cause mortality (or death from all causes). Taking 12,000 steps per day was associated with a 65% lower risk compared with taking 4,000 steps.\n",
    "\n",
    "# Merging data\n",
    "\n",
    "Before beginning to visualize the data, I need to merge two data sets. I’m going to merge (inner join) activity and sleep on columns Id and date (that I previously created after converting data to date time format)."
   ]
