   "source": [
    "The relationship between Total Minutes Asleep and Total Time in Bed looks linear. The CDC recommends adults 18-60 years get at least 7 or more hours (420 minutes) of sleep.  **So if the Bellabeat users want to improve their sleep, we should consider using notification prompting users that sleep less than 7 hours that they aren't getting the proper amount of sleep. We can also create a notification that suggests users to go to sleep based on their bahavorial patterns. We can call it \"sleep mode\".**\n",
    "\n",
    "\n",
    "Let's look at **intensities data** over time (hourly)."
   ]
