   "source": [
    "* After visualizing Total Intensity hourly, I found out that people are more active between 5 am and 10pm. \n",
    "\n",
    "* Most activity happens between 5 pm and 7 pm - It's possible people exercise or go to a gym. Or after finishing work they are walking more because they're running errands. **We can use this time in the Bellabeat app to remind and motivate users to excerise by going for a run or walk.**\n",
    "\n",
    "Let's look at the relationship between Total Minutes Asleep and Sedentry Minutes."
