   "source": [
    "* Here we can see a negative correlation between Sedentary Minutes and Sleep time.\n",
    "\n",
    "* As an idea: **if Bellabeat users want to improve their sleep, Bellabeat app can recommend reducing sedentary time. Bellabeat can show users data on the correlation of average active and sedentary minutes and how it relates to total minutes of sleep. Bellabeat can show users how they compare to other users. **\n",
    "\n",
    "* Keep in mind that we need to support this insights with more data, because correlation between some data doesn’t mean causation.\n",
    "\n",
    "\n",
    "# Summarizing recommendations for the business\n",
    "\n",
    "As we already know, collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n",
    "\n",
    "After analyzing FitBit Fitness Tracker Data, I found some **insights that would help influence Bellabeat marketing strategy.**\n",
    "\n",
    "\n",
    "**Target audience**\n",
    "\n",
    "Women who work full-time jobs (according to the hourly intensity data) and spend a lot of time at the computer/in a meeting/ focused on work they are doing (according to the sedentary time data).\n",
    "\n",
    "These women do some light activity to stay healthy (according to the activity type analysis). Even though they need to improve their everyday activity to have health benefits. They might need some knowledge about developing healthy habits or motivation to keep going. \n",
    "\n",
    "* As there is no gender information about the participants, I assumed that all genders were presented and balanced in this data set. \n",
    "\n",
    "**The key message for the Bellabeat online campaign**\n",
    "\n",
    "The Bellabeat app is not just another fitness activity app. \n",
    "It’s a guide (a friend) who empowers women to balance full personal and professional life and healthy habits and routines by educating and motivating them through daily app recommendations. \n",
    "\n",
    "**Ideas for the Bellabeat app**\n",
    "\n",
    "1. **Bellabeat can encourage people to take at least 8 000 explaining the benefits for their health.** Average total steps per day are 7638 which a little bit less for having health benefits for according to the CDC research. They found that taking 8,000 steps per day was associated with a 51% lower risk for all-cause mortality (or death from all causes). Taking 12,000 steps per day was associated with a 65% lower risk compared with taking 4,000 steps. \n",
    "\n",
    "2. **If users want to lose weight, or maintain a healthy BMI we can notify users with a BMI over 25 that they are at risk of becoming overweight or obese.** Bella can also suggest that users increase exercise intensity, active minutes and to reduce calorie intake until they are back to the \"healthy weight\". We could also offer a similar feature for users that are \"under weight\" according to their BMI. However this would notify individuals to increase their calorie intake.\n",
    "\n",
    "3. **If users want to improve their sleep, Bellabeat should consider using app notifications to go to bed and recommend at least 7 hours of sleep for adults 18 and over.** Over time Bellabeat can track and learn users patterns and suggest optimal sleep times to ensure users are getting the recommended amount of sleep.\n",
    "\n",
    "4. **Also if users want to improve their sleep, the Bellabeat app can recommend reducing sedentary time.** Bellabeat can show users data on the correlation of average active and sedentary minutes and how it relates to total minutes of sleep. Bellabeat can show users how they compare to other users.\n",
    "\n",
    "5. **We can use Bellabeat app to remind and motivate users to exercise between 5 pm and 7 pm.**\n",
    "\n",
    "\n",
    "\n"
   ]
